import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import GoogleBtn from '../GoogleBtn/googleBtn';
import Sidebar from './Sidebar/sidebar';
import './styles/navbar.css';

export default class Navbar extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isLogined: false,
            name: "",
            googleId: 0
        };
    }

    render() {
        return (
            <div>
                <nav class="navbar navbar-expand-lg navbar-light bg-light">
                    <Sidebar getUserId={this.props.getUserId()}/>
                    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                    <div class="collapse navbar-collapse" id="navbarText">
                        <ul class="navbar-nav mr-auto">
                            <li class="nav-item active">
                                <Link className="brandname nav-link" id="BrandName" to="/"> Minum Chess </Link>
                            </li>
                        </ul>
                        <span class="navbar-text">
                            <GoogleBtn setLoggedIn={this.props.setLoggedIn} setUserId={this.props.setUserId} setUsername={this.props.setUsername}/>
                        </span>
                    </div>
                </nav>
            </div>
        )
    }
}
